import { CYAN, YELLOW } from "../helpers/colors"

const Example = () => {
    const name = ['zahra', 'sara', 'maryam']
    const newName = name.map(n => (`Hello: ${n} `))

    return (
        <div style={{backgroundColor:CYAN}}>
            {name.map((n,index)=>(
                <p key={index}>name: </p>
            ))}
        </div>
    )
}

export default Example
